import React from 'react';

function Tasks(){

    const dates = [1,2,3,4,5];
    const months = ["jan", "feb", "march"];
    const arr = [];
    const arr2 = []

    function getArr(){
        for(let i = 0; i <months.length; i++){
            for(let j = 0; j<dates.length; j++){
                arr.push(dates[j] + " " + months[i]);
            }
        }
    }

    function doSplice(){
        arr.splice(2, 0, "NewTask");
        arr2.push(...arr);
    }

    function disp2(da){
        return <li>{da}</li>;
    }


    return(
        <div>
            {getArr()}
            {doSplice()}
            <button onClick = {arr2.map(disp2)}>add task</button>
        </div>
    );

}

export default Tasks;
